import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import {Link} from "react-router-dom";


class Menu extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <nav>
                <ul className="header">
                    <li>
                        <Link to='/'>
                            Users
                        </Link>
                    </li>
                    <li>
                        <Link to='/projects'>
                            Projects
                        </Link>
                    </li>
                    <li>
                        <Link to='/notes'>
                            Tasks
                        </Link>
                    </li>
                    <li>{this.props.is_user_get_cookie()}
                        <Link to='/login'>
                            Log in
                        </Link>
                    </li>
                </ul>
            </nav>
        )
    }
}

export default Menu
